import React from 'react';
import { Link } from 'react-router-dom';

let shoeObj = {
    obj1: {
        name: "Ahmed Shoe",
        img: "data:image/jpeg;base64,"
    },

    obj2: {
        name: "Mehran Shoe",
        img: "data:image/jpeg;base64,"
    },

    obj3: {
        name: "Kashan Shoe",
        img: "data:image/jpeg;base64,"
    }
}
// console.log(shoeObj);

const MyProfile = () => {
    return (
        <React.Fragment>
            <ul>
                {
                    Object.entries(shoeObj).map(([index, { name, img }]) => {
                        return (
                            <li key={index}>
                                <Link to={`/about/${index}`}>
                                    <h2> {name} </h2>
                                    <img src={img} alt={name} />
                                </Link>
                            </li>
                        );
                    })
                }
            </ul>
        </React.Fragment>
    );
}

export default MyProfile;